import React, { useState } from 'react';
import { useWeb3 } from '../context/Web3Context';

const TradingForm = () => {
    const { contracts, account } = useWeb3();
    const [amount, setAmount] = useState('');
    const [leverage, setLeverage] = useState('2');
    const [positionType, setPositionType] = useState('long');
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (!amount || !leverage) {
            setError('Please fill in all fields');
            return;
        }

        try {
            setLoading(true);
            setError(null);

            const amountWei = window.web3.utils.toWei(amount, 'ether');
            const leverageValue = parseInt(leverage);

            if (positionType === 'long') {
                await contracts.marginTrading.methods
                    .openLongPosition(amountWei, leverageValue)
                    .send({ from: account });
            } else {
                await contracts.marginTrading.methods
                    .openShortPosition(amountWei, leverageValue)
                    .send({ from: account });
            }

            // Reset form
            setAmount('');
            setLeverage('2');
            setPositionType('long');

        } catch (error) {
            setError(error.message);
        } finally {
            setLoading(false);
        }
    };

    const handleClosePosition = async () => {
        try {
            setLoading(true);
            setError(null);

            await contracts.marginTrading.methods
                .closePosition()
                .send({ from: account });

        } catch (error) {
            setError(error.message);
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="trading-form">
            <h2>Open Position</h2>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label htmlFor="amount">Amount (ETH)</label>
                    <input
                        type="number"
                        id="amount"
                        value={amount}
                        onChange={(e) => setAmount(e.target.value)}
                        step="0.0001"
                        min="0"
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="leverage">Leverage</label>
                    <select
                        id="leverage"
                        value={leverage}
                        onChange={(e) => setLeverage(e.target.value)}
                    >
                        <option value="2">2x</option>
                        <option value="3">3x</option>
                        <option value="5">5x</option>
                        <option value="10">10x</option>
                        <option value="20">20x</option>
                    </select>
                </div>

                <div className="form-group">
                    <label htmlFor="positionType">Position Type</label>
                    <select
                        id="positionType"
                        value={positionType}
                        onChange={(e) => setPositionType(e.target.value)}
                    >
                        <option value="long">Long</option>
                        <option value="short">Short</option>
                    </select>
                </div>

                {error && <div className="error">{error}</div>}

                <button type="submit" disabled={loading}>
                    {loading ? 'Processing...' : 'Open Position'}
                </button>
            </form>

            <div className="close-position">
                <h2>Close Position</h2>
                <button
                    onClick={handleClosePosition}
                    disabled={loading}
                    className="close-button"
                >
                    {loading ? 'Processing...' : 'Close Position'}
                </button>
            </div>
        </div>
    );
};

export default TradingForm;
